ത്രികോണം $ABC$ സമദ്വിബാഹു ആണ്, $AB=AC$ കൂടാതെ ഉയരം $AM=11.$ $\overline{AM}$-ൽ $AD=10$ ആയ ഒരു ബിന്ദു $D$ ഉണ്ട്, കൂടാതെ $\angle BDC=3\angle BAC.$  ത്രികോണം $ABC$-യുടെ പരിധി കണ്ടെത്തുക.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

